import React from "react";
import backgroundimage from "./images/kelli-mcclintock-wBgAVAGjzFg-unsplash.jpg";

function Dashboard() {
  return (
    <div>
      {/* Background Section */}
      <div
        className="h-screen flex justify-center items-center bg-cover bg-center"
        style={{ backgroundImage: `url(${backgroundimage})` }}
      >
        <h1 className="text-center text-white text-4xl font-bold shadow-lg">
          THE HOME OF MILITARY MENTAL HEALTH
        </h1>
      </div>

      {/* Content Section */}
      <div className="px-6 py-8 bg-slate-50">
        <h2 className="text-2xl font-bold mb-4">Our Mission</h2>
        <p className="text-lg leading-relaxed">
          The Lemich Clinic for Military Mental Health was founded on the belief
          that everyone who serves should have access to high quality,
          confidential, mental health care. The majority of our clients are active
          duty sailors at Naval Station Norfolk. We also see service members from
          the other military installations in Virginia. We also work with military
          spouses and recent veterans. If you are a first responder or outside
          the military, contact us to see if you qualify for our program.
        </p>
      </div>
    </div>
  );
}

export default Dashboard;
